const VollkornRegular = `@font-face { font-family: 'Vollkorn'; font-style: normal; font-weight: 400; src: local('Vollkorn Regular'), local('Vollkorn-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const VollkornItalic = `@font-face { font-family: 'Vollkorn'; font-style: italic; font-weight: 400; src: local('Vollkorn Italic'), local('Vollkorn-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Vollkorn600 = `@font-face { font-family: 'Vollkorn'; font-style: normal; font-weight: 600; src: local('Vollkorn SemiBold'), local('Vollkorn-SemiBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Vollkorn600italic = `@font-face { font-family: 'Vollkorn'; font-style: italic; font-weight: 600; src: local('Vollkorn SemiBold Italic'), local('Vollkorn-SemiBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Vollkorn700 = `@font-face { font-family: 'Vollkorn'; font-style: normal; font-weight: 700; src: local('Vollkorn Bold'), local('Vollkorn-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Vollkorn700italic = `@font-face { font-family: 'Vollkorn'; font-style: italic; font-weight: 700; src: local('Vollkorn Bold Italic'), local('Vollkorn-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Vollkorn900 = `@font-face { font-family: 'Vollkorn'; font-style: normal; font-weight: 900; src: local('Vollkorn Black'), local('Vollkorn-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
const Vollkorn900italic = `@font-face { font-family: 'Vollkorn'; font-style: italic; font-weight: 900; src: local('Vollkorn Black Italic'), local('Vollkorn-BlackItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
